import React, { useState, useEffect } from 'react';
import axios from 'axios';

const FetchRegistrations = () => {
    const [res, setRes] = useState([]);
    const [formData, setFormData] = useState({ email: '', password: '' });
    const [isAuthenticated, setIsAuthenticated] = useState(false);

    const fetchData = async () => { 
        axios.get('http://localhost:8080/retrieve')
            .then(response => {
                setRes(response.data);
                console.log(response.data);
            })
            .catch(error => console.error('Error fetching data:', error));
    };

    useEffect(() => {
        fetchData();
    }, []);

    const handleSignIn = () => {
        const { email, password } = formData;
        const user = res.find(user => user.email === email && user.password === password);
        if (user) {
            console.log('User authenticated:', user);
            setIsAuthenticated(true);
            // Redirect to success page or perform any other action
        } else {
            console.log('Invalid credentials');
            // Handle invalid credentials, display error message, etc.
        }
    };

    const changeHandler = (e) => {
        setFormData({ ...formData, [e.target.name]: e.target.value });
    };

    return (
        <center>
            <table border={1}>
                <thead>
                    <tr>
                        <th>Id</th>
                        <th>Name</th>
                        <th>Role</th>
                        <th>Email</th>
                        <th>Password</th>
                        <th>Action</th>
                    </tr>
                </thead>
                <tbody>
                    {res.map((item, index) => (
                        <tr key={index}>
                            <td>{item._id}</td>
                            <td>{item.name}</td>
                            <td>{item.role}</td>
                            <td>{item.email}</td>
                            <td>{item.password}</td>
                            <td>
                                <button onClick={handleSignIn}>Sign In</button>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </center>
    );
};

export default FetchRegistrations;
